  false,\n\t\"url\": null,\n\t\"notes\": \"The Montana Structures/Addresses Framework
  is a statewide spatial database of structure and address points in the State of
  Montana. The Montana Structures/Addresses Framework is part of the Montana Spatial
  Data Infrastructure (MSDI). The goal of the Montana Structures/Addresses Framework
  is to have a routinely updated statewide database of primary structures/buildings
  and addresses. Through a federated approach, the project integrates structures and
  address data from local, state, federal and private data providers into a standardized
  database. For more information about the included datasets, see Source information
  in the Data Quality Information section of this document or the feature level metadata
  tables in the database.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
